import "../styles/main.css";

function Timeline() {

    const AppleDescription="Robots";
    const TeslaDescription="Cars";
    const UberDescription="EVs";

    return (
        <div class="Timeline">
            <div class="container">
                <div class="text-box">
                    <h2>Apple Inc.</h2>
                    <small>2021 - Current</small>
                    <p>{AppleDescription}</p>
                </div>
            </div>
        </div>


    ); 
};

export default Timeline;
